支持的写法详情见 katex官方文档 多行公式 为公式加编号：\tag{number} $$ f(x) = x+1\tag{1} $$ 在VSCODE中必须使用aligned环境，如： $$ \begin{aligned} a&=1\ &=2 \end{aligned} $$ $$
\begin{aligned}
a&=1\\
&=2
\end{aligned}
$$ 分段函数 使用cases环境 $$
f(x) = \begin{cases}
a, a<1,\\
b, a\geq1.
\end{cases}
$$
效果如下 $$ f(x) = \begin{cases} a&, a<1,\ b&, a\geq1. \end{cases} $$ 文内链接 [能够点击的链接](#name)
